import { useState } from "react";
import '../ComponentStyles/login.css'
import { Button } from "react-bootstrap";

function Login() {

    const [loginUsername, setLoginUsername] = useState("");
    const [loginPassword, setLoginPassword] = useState("");

    return (
        <div className="login-container">
            <div className="login-card">
                <div className="title-container">
                    <h3>Log in to Your Account</h3>
                </div>
                <div className="login-inputs-container">
                <input value={loginUsername} className="form-control header-input" />
                <input value={loginPassword} className="form-control header-input" />   
                </div>
                <div className="login-btn-container">
                    <Button variant="btn-success" className="login-btn">Log In</Button>
                </div>
            </div>
        </div>
    )
}

export default Login;
